import {Form, Card} from "react-bootstrap";
const Signup = () => {
    return ( 
        <Card style={{"margin":"20px 270px 20px 270px"}}>
            <Form>
                <Container>
                    <Form.Group controlId="fromEmail" >
                        <Row>
                            <Col>
                                <Form.Label>Email</Form.Label>
                                <Form.Control type="email" placeholder="exmple@mail.com"/>
                            </Col>
                        </Row>
                    </Form.Group>
                </Container>
            </Form>
        </Card>
     );
}
 
export default Signup;
